            setcore(newScore)
        })()
        return () => {}
    },[])

    const getScore = async () => {
        const scoreJson = await fetch ("https://animalfinderapi.herokuapp.com/score%27")
        return await scoreJson.json()
    }

    if (!score){

        return <p>Waiting</p>
    }

    return <p>{score.data.map(result => <div><p>{result.username}</p> <p>{result.score}</p> <img src= {result.avatar}/></div>)}</p>

}
